    state = {
        orders: [],
        loading: true
    }

    componentDidMount() {

        axios.get('./orders.json')
            .then(res => {
                console.log(res.data)
                this.setState({loading: false});
            })
            .catch(err => {
                this.setState({loading:false});
            })

    }

    render() {
        return (
            <div>
                <Order />
                <Order />
            </div>
        );
    }

}

export default Orders;
